            <div class="main-text cp-text-block">
                <h2 class="main-title">Erdély, Partium</h2>
                <p class="description">
                    Az első világháború évei alatt megerősödött erdélyi magyar színjátszás a trianoni békét
                    követően kisebbségi helyzetbe került, működési keretei egyre szűkebbé váltak. A korlátozó
                    intézkedések a magyar színészeknek otthont adó színházépületeket is érintették: a legtöbb
                    városban a színházat hosszabb-rövidebb időre át kellett engedni a román együtteseknek. A
                    magyar társulatok anyagi helyzete hamar leromlott, hiszen az utódállam részéről nem
                    részesültek támogatásban.
                    A legjelentősebb társulat a kolozsvári volt, amelynek vezetője, Janovics Jenő a korszak
                    egyik legmeghatározóbb alakja volt nemcsak az erdélyi, hanem az egész magyar színházi
                    életben. A nagyobb városokban működő társulatvezetők még ezekben a nehéz időkben is
                    igyekeztek értékes műsort összeállítani, ám ezt a törekvést nem mindig koronázta siker. Az
                    igazgatók többsége nem tudott kiváló művészi erőkből álló társulatot szervezni, a színpadi
                    újdonságok megszerzésére sem futotta bevételéből, így sokszor műsorukat a jövedelmezőbb,
                    bevált szórakoztató darabokra, elsősorban az operett műfajára alapozták.
                    Tovább súlyosbította a magyar társulatok helyzetét, hogy a bevétel jelentős részét előbb 32,
                    majd 26 százalékos látványossági adóval terhelték. Egyre kevesebb város maradt Erdélyben és
                    a Partiumban, amely egymaga el tudta tartani társulatát a teljes szezonon keresztül; a
                    színházigazgatók két-három, vagy akár több várost kerestek fel társulataikkal. A két
                    világháború között ugyan mind a színészek, mind a közönség mentőakciókat indítottak a magyar
                    hivatásos színjátszás megsegítésére, a kisebbségek önrendelkezési jogának megcsorbítása,
                    valamint a világgazdasági válság elsöpörték ezeket a kezdeményezéseket.
                </p>
